import React from "react";
import { Provider } from "react-redux";
import GlobalStyles from "./styles/global";
import store from "./store";
import Routes from "./routes/index";

function App() {
  return (
    <>
      <Provider store={store}>
        <Routes />
        <GlobalStyles />
      </Provider>
    </>
  );
}

export default App;
